public class InnerVirtualNodeVirtualNodeSpecFactory(Action<Humidifier.AppMesh.VirtualNodeTypes.VirtualNodeSpec> factoryAction = null) : SubResourceFactory<Humidifier.AppMesh.VirtualNodeTypes.VirtualNodeSpec>
{

    internal InnerVirtualNodeLoggingFactory LoggingFactory { get; set; }

    internal InnerVirtualNodeBackendDefaultsFactory BackendDefaultsFactory { get; set; }

    internal InnerVirtualNodeServiceDiscoveryFactory ServiceDiscoveryFactory { get; set; }

    protected override Humidifier.AppMesh.VirtualNodeTypes.VirtualNodeSpec Create()
    {
        var virtualNodeSpecResult = CreateVirtualNodeSpec();
        factoryAction?.Invoke(virtualNodeSpecResult);

        return virtualNodeSpecResult;
    }

    private Humidifier.AppMesh.VirtualNodeTypes.VirtualNodeSpec CreateVirtualNodeSpec()
    {
        var virtualNodeSpecResult = new Humidifier.AppMesh.VirtualNodeTypes.VirtualNodeSpec();

        return virtualNodeSpecResult;
    }
    public override void CreateChildren(Humidifier.AppMesh.VirtualNodeTypes.VirtualNodeSpec result)
    {
        base.CreateChildren(result);

        result.Logging ??= LoggingFactory?.Build();
        result.BackendDefaults ??= BackendDefaultsFactory?.Build();
        result.ServiceDiscovery ??= ServiceDiscoveryFactory?.Build();
    }

} // End Of Class

